//Favorites
import {connect} from 'react-redux';

export function Favorites({myFavorites}){
	return(<div>
		{myFavorites.map((ch)=><ul>	
		<li>{ch.name}</li>
		<li>{ch.species}</li>
		<li>{ch.gender}</li>
		</ul>)}
		</div>)
	}
function mapStateToProps(state){
	return{
		myFavorites:state.myFavorites
		}
	}
export default connect(mapStateToProps)(Favorites)
